import React, { Component } from 'react';

export class Hero extends Component {
    render() {
        return (
            <div>
                <p>Hola! Soy <strong>Manuel Mendoza</strong><br/> Desarrollador #DeveloperFrontend en<br/>JavaScript React-js</p>
            </div>
        );
    }
}

export default Hero;
